import React, {Component} from 'react';

class Table extends Component {
	render () {
		return (
			<table>
				<TableHeader />
				<TableBody />
			</table>
		);
	}
}

const TableHeader = () => {
	return (
		<thead>
			<tr>
				<th>Name</th>
				<th>Job</th>
			</tr>
		</thead>
	);
}

const TableBody = () => {
	return (
		<tbody>
            <tr>
                <td>Morten</td>
                <td>Janitor</td>
            </tr>
            <tr>
                <td>Mac</td>
                <td>Bouncer</td>
            </tr>
            <tr>
                <td>Dee</td>
                <td>Aspiring actress</td>
            </tr>
            <tr>
                <td>Dennis</td>
                <td>Bartender</td>
            </tr>
        </tbody>
	);
}


export default Table;
